def count_mystical_numbers(A, queries):
    n = len(A)
    cd = {}
    for i in range(32):
        cd[i] = 0
    counts = [cd]
    for j in range(n):
        newc = counts[j].copy()
        if A[j] != 0:
            digs = int(math.log2(A[j])) + 1
        else:
            digs = 0
        newc[digs] -= 1
        counts.append(newc)
    results = []
    for (L, R, X) in queries:
        if X != 0:
            xd = int(math.log2(X)) + 1
        else:
            xd = 0
        result = R - L + 1 - (counts[R][xd] - counts[L - 1][xd])
        results.append(result)
    return results

